import React from 'react';
import { NavLink } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import companyLogo from './assets/css/book-my-party.jpg'; // Adjust the path as needed
import './assets/css/Header.css'; // External CSS for additional styling

const Header = () => {
  return (
    <header className="bg-dark text-white p-3">
      <nav className="navbar navbar-expand-lg navbar-dark">
        <div className="container">
          <div className="d-flex justify-content-between w-100 align-items-center">
            {/* Company Logo */}
            <NavLink className="navbar-brand" to="/">
              <img src={companyLogo} alt="Company Logo" className="logo-img" />
            </NavLink>
            
            {/* Login Button */}
            <NavLink className="btn btn-light text-dark" to="/login">
              Login
            </NavLink>
          </div>
        </div>
      </nav>
    </header>
  );
};

export default Header;
